a2b3996e-110a-46c3-938a-02e444acd62c	render_filenames	render_filenames	exec	55	1	{"code":"module.exports = async function (data) {\\n  function safe(v, fallback = \\"na\\") {\\n    if (v === null || v === undefined) return fallback;\\n    const s = String(v).trim();\\n    return s.length ? s : fallback;\\n  }\\n\\n  function render(template, ctx) {\\n    return template.replace(/\\\\{\\\\{\\\\s*([^}]+?)\\\\s*\\\\}\\\\}/g, (_, key) => safe(ctx[key.trim()]));\\n  }\\n\\n  //  capture fields come from trigger payload in your runtime\\n  const cap = data.$trigger.payload;\\n\\n  //  template comes from the previous Read Template op, as an array\\n  // Your $last_keys: [\\"0\\"] confirms this\\n  const tpl = Array.isArray(data.$last) ? data.$last[0] : data.$last;\\n\\n  if (!cap) throw new Error(\\"missing $trigger.payload\\");\\n  if (!tpl?.mlcapture) throw new Error(\\"missing template.mlcapture\\");\\n\\n  //  IMPORTANT: your payload uses piece_id (not pieces_id)\\n  //  capture_id is the trigger key (since payload doesnt include id)\\n  const ctx = {\\n    capture_id: data.$trigger.key,\\n    piece_id: cap.piece_id,\\n    game_catalog_id: cap.game_catalog_id,\\n    ext: \\"jpg\\",\\n  };\\n\\n  return {\\n    fullImageFilename: render(tpl.mlcapture.fullImageFilename, ctx),\\n    thumbnailFilename: render(tpl.mlcapture.thumbnailFilename, ctx),\\n  };\\n};\\n"}	e3c24283-1f60-4308-9619-6995bebb3189	\N	5f4a0df1-7a3e-4e8f-a7b1-02fa0536fb92	2026-01-05 02:57:00.777+00	08f72b0e-58c8-4dde-a112-d1256673b441
